$(document).ready(function(){var n;$.ajax({url:"dist/js/datos.json"}).done(function(o){o.canciones.sort(function(n,o){return n.reproducciones<o.reproducciones?1:-1}),n="";for(var c=0;c<3;c++)n+=`\n            <div class="row mb-3">\n                <div class="col-4 text-primary">${o.canciones[c].nombre}</div>\n                <div class="col-8"><audio src="dist/canciones/${o.canciones[c].ruta}" controls preload="auto"></audio></div>\n            </div>\n            `,document.getElementById("cajatabla").innerHTML=n})});